INSERT INTO `blogs` (`id`, `title`, `blog_text`, `category_id`, `user_id`, `status`, `blog_thumbnail`, `blog_cover`, `added_date`, `modified_date`) VALUES
(1, 'OAXACA: AN EVEN BIGGER LOVE STORY', '<p>Have you ever arrived at a destination and just knew it&rsquo;s for you? Something in the air just told you that this place is everything you dreamed it to be and you were going to be in love with it forever.</p>\r\n\r\n<p>I&rsquo;ve felt this way only a few other times before, in&nbsp;<a href=\"https://www.nomadicmatt.com/travel-guides/france-travel-tips/paris/\" target=\"_blank\">Paris</a>,&nbsp;<a href=\"https://www.nomadicmatt.com/travel-guides/china-travel-tips/hong-kong/\" target=\"_blank\">Hong Kong</a>, and&nbsp;<a href=\"https://www.nomadicmatt.com/travel-guides/japan-travel-tips/tokyo/\" target=\"_blank\">Tokyo</a>.</p>\r\n\r\n<p>And I felt that way again when I got to Oaxaca.</p>\r\n\r\n<p>The city&rsquo;s energy and mine just synched. We were a pair. I could recognize the signs: a sense of unconditional joy emerged in my heart. My eyes constantly shifted to every shade of color, every movement, as if I had an insatiable hunger to take in everything. I was in love.</p>\r\n\r\n<p><img alt=\"\" src=\"https://media.nomadicmatt.com/2021/oaxaca3.jpg\" style=\"height:351px; width:600px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n', '1', 1, 1, '4b35846cb1d2dc439a39d5b1b47d1be4.jpg', '1b288f0b0e9c3a79d1a35ab8b92eaa1f.jpg', '1614448800', '1614448800');
